import CompBtn from "./CompBtn";
import CompDiv from "./CompDiv";

function App() {
  return (
    <>
      <p>
        버튼을 클릭할때마다 div가 추가됩니다. <br />
        div의 키값으로는 timeStamp를 사용하세요 <br />
        브라우저를 종료후 다시 실행할 경우 div의 숫자는 이전과 동일하게 출력되어야 합니다.
      </p>
      <hr />
      <CompDiv />
      <CompBtn />
    </>
  );
}

export default App;
